                                                    <h3>Los primeros años: tres ruedas y la reconstrucción de una ciudad.</h3>
                    ");
            WriteLiteral(@"                                <p>El primer vehículo que fue lanzado por la marca, fue el modelo MazdaGo de tres ruedas, que se exportó a la India y China, países en los que se hizo muy popular gracias a su maniobrabilidad. Este es solo un ejemplo del planteamiento poco convencional y la actitud positiva y dinámica de Mazda, que viene de la mano del ""espíritu de Hiroshima"" de superar los desafíos. Aun así, la demostración definitiva del espíritu único de Mazda se produjo en 1945. Justo después del lanzamiento de la bomba atómica. Mazda desempeñó un papel esencial en la reconstrucción de Hiroshima, ya que la planta de Mazda resultó relativamente indemne en la catástrofe y se utilizó como base para organizar la reconstrucción y prestar servicios de auxilio.</p>

                                                    <br />

                                                    <h3>El motor rotativo: rompiendo con lo establecido.</h3>
                                                    <p>Un motor verdaderament");
            WriteLiteral(@"e revolucionario, por otra parte, hace exactamente eso: revoluciona y gira. Este fue el planteamiento en torno al motor rotativo de Felix Wankel, en el que la combustión hace girar un disco plano en lugar de empujar los pistones hacia arriba y hacia abajo. Mazda adquirió esta tecnología a finales de la década de los cincuenta y es el único fabricante que sigue aplicando este concepto de motor diferente de los demás hasta la fecha. Perfecto para su uso en carros deportivos gracias a sus dimensiones reducidas y su alto nivel de revoluciones por minuto, el motor rotativo se incorporó en diversos modelos de Mazda, desde el sorprendente Cosmo 110S hasta los legendarios RX-7 y RX-8. El motor rotativo también se incluyó en los carros de carreras 787, famosos por ganar las 24 horas de Le Mans en 1991.</p>
                                                    <p>Sus dimensiones reducidas y su alto nivel de revoluciones por minuto, el motor rotativo se incorporó en diversos modelos de Mazda, desde el sorprendente Cosmo ");
            WriteLiteral(@"110S hasta los legendarios RX-7 y RX-8. El motor rotativo también se incluyó en los carros de carreras 787, famosos por ganar las 24 horas de Le Mans en 1991.</p>
                                                    <br />

                                                    <h3>El MX-5: el roadster ha vuelto para quedarse.</h3>
                                                    <p>En la década de los ochenta, ya no se fabricaban roadsters. Su auge en la Gran Bretaña de los cincuenta y los sesenta se había acabado. Sin embargo, apareció Mazda con su planteamiento de crear un roadster deportivo para tiempos más modernos que fuera fiable y divertido de conducir, con el objetivo de romper con los planteamientos convencionales y diseñar un carro que recuperara el placer de manejar en su concepto más básico. La balanza se inclinó por el MX-5 original que, con solo 955 kilogramos, era un carro deportivo verdaderamente ligero que además, podía presumir de un diseño con motor delantero y tracción trasera con una ");
            WriteLiteral(@"dinámica de conducción excepcional. El roadster había vuelto a nacer. De hecho, el MX-5 era tan divertido de conducir y suponía tal placer tener uno, que se convirtió en el roadster más vendido de todos los tiempos.</p>
                                                    <p>955 kilogramos, era un carro deportivo verdaderamente ligero que además, podía presumir de un diseño con motor delantero y tracción trasera con una dinámica de conducción excepcional. El roadster había vuelto a nacer. De hecho, el MX-5 era tan divertido de conducir y suponía tal placer tener uno, que se convirtió en el roadster más vendido de todos los tiempos.</p>

                                                    <br />
                                                    <h3>

                                                        La victoria en Le Mans: una revolución en 24 horas
                                                    </h3>
                                                    <p>Ningún equipo japonés había ganado ");
            WriteLiteral(@"nunca la competición de Le Mans...hasta 1991. Ese fue el año en que Mazda rompió definitivamente con las normas establecidas e introdujo sus carros de carreras 787 con motor rotativo en la prueba de resistencia más prestigiosa y antigua del mundo. A pesar de la falta de potencia de los 787 en la competición, contaban con la ventaja de ofrecer una mayor fiabilidad y Mazda consiguió liderar y ganar la carrera. Se trata de un hito y un récord que sigue vigente hasta la fecha, ya que Mazda es el único equipo japonés que ha ganado esta competición y es la única victoria que ha conseguido un carro con un motor cuyo diseño no es de tipo alternativo. Todo gracias a un planteamiento diferente y a nuestra determinación de romper con lo establecido.</p>
                                                    <p></p>

                                                    <br />
                                                    <h3>
                                                        La generación Zoom Zoom: desde el");
            WriteLiteral(@" Mazda6 hasta el RX-8
                                                    </h3>
                                                    <p>Un nuevo diseño acompañado de un nuevo slogan, Zoom-Zoom, representa la energía que sentíamos de niños con el movimiento. Plasmando esta idea en los automóviles, se consigue una experiencia de conducción dinámica, además de un diseño sorprendente. El Mazda 6 es la primera expresión de este planteamiento y se lanza entre grandes alabanzas en 2002. Le sigue el revolucionario e innovador RX-8 en 2003. Se trata de un carro verdaderamente orientado al conductor que incluye unas versátiles puertas ""freestyle"" y una interpretación moderna del motor rotativo, ganador de los galardones ""Motor Internacional del Año"" y ""Mejor Motor Nuevo"".</p>

                                                    <br />
                                                    <h3>
                                                        EL 90 ANIVERSARIO
                                                  ");
            WriteLiteral(@"  </h3>
                                                    <p>
                                                        90 años de superación gracias a 90 años de ideas fuera de lo convencional.

                                                        Si analizamos los carros que Mazda ha diseñado durante más de 90 años, observaremos fácilmente que tener planteamientos diferentes nos ha llevado a fabricar carros apasionantes, innovadores y divertidos de manejar, todo ello de la mano de un grupo único de profesionales apasionados. Desde el superventas MX-5 hasta el dinámico CX-7, Mazda ha seguido sacando el máximo partido a su tradición de ingeniería innovadora y a su espíritu revolucionario. Ahora vamos por los siguientes 90 años.
                                                    </p>

                                                    <br />
                                                    <h3>EL FUTURO</h3>
                                                    <p>Desde el movimiento con alma ha");
            WriteLiteral(@"sta el diseño de motores radicalmente diferentes, el futuro se presenta emocionante para Mazda. Con un bagaje de innovación de casi un siglo, seguiremos buscando soluciones únicas para los desafíos a los que nos enfrentemos haciendo las cosas como nadie más puede soñar hacerlas. Nuestra nueva Tecnología SKYACTIV reduce el consumo de combustible al tiempo que lleva el placer de manejar a nuevos niveles y nuestro nuevo diseño ""KODO - Alma del Movimiento"" te acelera el corazón como nunca lo había hecho antes.</p>
                                                </div>
