 ");
            WriteLiteral(@"                                       <div class=""row"">
                                            <div class=""col"">
                                                <div class=""text-center"">
                                                    <p>El desafío de pensar en cada detalle milimétricamente, se ve reflejado en Ryo Yanagisawa y su equipo de diseño e innovación, quienes aplicaron el lenguaje de diseño “KODO – Alma del movimiento” a un carro concepto denominado Hazumi, que luego se convirtió en la inspiración para hacer realidad el Nuevo Mazda 2, el cual hoy hace parte de la última generación de vehículos Mazda a nivel global.</p>
                                                </div>
                                            </div>
                                        </div>
                                    </div>

                                    <div id=""info3"">
                                        <div class=""row"">
                                            <div class=""col");
