                                            </div>
                                        </div>
                                        <div class=""row"">
                                            <div class=""col"">
                                                <div class=""text-center"">
                                                    <h2>Nos desvelamos por crear una idea brillante</h2>
                                                    <p>A lo largo de nuestra historia nos hemos enfrentado a numerosos desafíos. Nuestra filosofía es tomar esos desafíos como oportunidades de innovación para realizar desde un diseño inspirado en la naturaleza, hasta carros que te conectan con la carretera y el mundo que te rodea. No podemos evitar abordar cada desafío desde un punto de vista diferente. Eso es lo que nos convierte en lo que somos, porque rompemos con lo establecido en cada paso que damos.</p>

                                                    <p>Desde el espíritu");
            WriteLiteral(@" de Hiroshima a las relaciones de compresión más elevadas en los motores de gasolina y diesel, se nos conoce por hacer posible lo imposible. Esto gracias a nuestra mentalidad y nuestra actitud positiva y dinámica, además de una filosofía de ingeniería que tiene como objetivo romper con lo establecido para alcanzar los mejores resultados posibles, bien sea un diseño aerodinámico sorprendente o una sensación de que tu carro y tú son uno solo cuando lo conduces.</p>
                                                </div>
                                            </div>
                                        </div>
                                    </div>

                                    <div id=""info4"">
                                        <div class=""row"">
                                            <div class=""col-lg-12 col-md-12 col-xs-12"">

                                            </div>
                                        </div>
                                        <div clas");
            WriteLiteral(@"s=""row"">
                                            <div class=""col"">
                                                <div class=""text-center"">
                                                    <p>El concepto Jinba-Ittai viene de los arqueros montados japoneses Yabusame, un espectáculo en el que los arqueros disparan tres flechas especiales en tres blancos mientras montan un caballo en movimiento. Este espectáculo fue creado hace cientos de años para perfeccionar la habilidad de arquería de los Yabusame, y se basa completamente en la conexión entre el jinete y su caballo. En Mazda hemos reinventado el Jinba-Ittai para conectarte con tu vehículo a través de la tecnología y el diseño en nuestros vehículos, para que tu experiencia de manejo sea mucho más placentera y seas uno solo con tu Mazda recorriendo el camino.</p>
